import React, { Component } from 'react'

export default class Product extends Component {
    constructor(props){
        super(props);
        this.state = {
            category: props.category,
            proizvodi: []
        }
    }
  render() {
    return (
      <div>
        <h1>Proizvodi {this.state.category}</h1>
      </div>
    )
  }
}
